import "./App.css";

function App() {
  const names = ["Aram", "Ali", "Gity", "baba", "maman", "Elina", "Emad"];
  return (
    <div className="App">
      {names.map((name, index) => {
        return <h1 key={index}>{name}</h1>;
      })}
    </div>
  );
}

